import IMG11 from '../../img/box_4_2.png';




const Services_2 = () => {
  return (
    <div className="services">

    {/* right side */}
    <div className="cards">

        {/* first card */}
        <div style={{top: '2rem',left: '-1rem'}}>
            <Card_1
            img1={GAMERS}
            img5 = {ARROW}
            img2 = {IMG2}
            img3 = {IMG3}
